import styled from "styled-components";
const MainWrapper = styled.div`
height: 300px;
display: flex;
align-items: center;
width: 100%;
font-weight: 600;
font-size: 40px;
text-align: center;
`
const MainTitle = () => {
    return (
        <MainWrapper>
            Discover additional information about
            <br />
            a vehicle that you currently possess
            <br />
            or intend to buy:
        </MainWrapper>
    )
}
export default MainTitle;
